import ring from "../assets/icons/ring-icon.svg";

const About = () => {
    return (
        <section className="about-fity">
            <div className="w-3/5 items-center ml-auto mr-auto p-5">
                <h2 className="text-center text-[36px] font-bold">Uštedi novac, vreme i energiju potrebnu za planiranje i praćenje obroka</h2>
                <p className="text-[23px] text-center">Fity ti predlaže šta, koliko i kada da jedeš, u odnosu na tvoje ciljeve, preference i potrebe. Obroci su zdravi, ukusni i brzi. Za tebe generiše šoping listu namirnica i daje ti mogućnost da pratiš napredak. I još mnogo toga, za već <strong>od 575 RSD mesečno.</strong></p>
                <div className="flex w-[350px] hero-button mt-8 justify-center mr-auto ml-auto">
                    <p className="text-white pr-4 text-[18px] font-semibold">Budi među prvim korisnicima</p>
                    <img src={ring} alt="ring icon" />
                </div>
            </div>
        </section>
    );
};

export default About;
